import { useEffect, useState } from 'react'

const tabs = ['comments', 'post', 'albums']
function Content() {
  const [comments, setComments] = useState([])
  const [type, setType] = useState('comments')

  useEffect(() => {
    fetch(`https://jsonplaceholder.typicode.com/${type}`)
      .then(res => res.json())
      .then(data => {
        setComments(data)
      })
  }, [type])
  console.log(type)

  return (
    <div>
      {tabs.map(tabs => (
        <button onClick={() => setType(tabs)}> {tabs} </button>
      ))}

      <ul>
        {comments.map(data => (
          <li>{data.name}</li>
        ))}
      </ul>
    </div>
  )
}

export default Content
